import Nav from "./Nav";

const Header = () => (
  <div>
    <div className="bar">
      <a href="">Ecomm</a>
      <Nav></Nav>
    </div>

    <div className="sub-bar">
      <p>Search</p>
    </div>
    <div>Cart</div>
  </div>
);
export default Header;
